 , during allergic inflammation . Here , we examined the role of histamine in

 production using an ELISA . Four potential downstream signaling molecules , p38 , extracellular signal-regulated kinase (

 antagonist significantly decreased

 production in histamine-stimulated nasal fibroblasts . DB11320 increased the expression level of phosphorylated p38 ( pp38 ) , pERK , and pJNK , as well as NF-B induction . The

<div class="entities" style="line-height: 2.5; direction: ltr">Characterization of antihistamines using biphasic cutaneous reaction in BALB / c mice . Effects of 11 histamine H1 receptor antagonists on IgE-mediated biphasic cutaneous reaction in mice were examined . The immediate phase reaction ( IPR ) assessed at 1 hour after antigen application was significantly inhibited by all antihistamines examined . The inhibition of IPR by cetirizine and mequitazine were potent , but those by cyproheptadine and diphenhydramine were weak . The later phase reaction ( LPR ) assessed at 24 hours after antigen application was inhibited by chlorpheniramine , oxatomide , ketotifen , mequitazine , emedastine , terfenadine and azelastine . The inhibition of LPR by emedastine was potent , but those by ketotifen and terfenadine were only partial .
